/**
 * Navigate to destination path if provided
 *
 * @param {object} instance - Component instance for 'history' and 'replace' prop
 * @param {string|Object} path - path to navigate to
 * @param {object} [result] - optional result to pass along on the location state
 */
export function navigateTo(instance: object, path: string | any, result?: object): void;
